def ierf(X):
	return X*special.erf(X)-(1/np.sqrt(np.pi))*(1-np.exp(-X**2))
	
def Ils(h,d):
	return 2*ierf(h) + 2*ierf(h+2*d) - ierf(2*h+2*d) - ierf(2*d)
	
def g_FLSjc(x,y,ro,z,H,lm,Cm,t):
	# Finite Line Sourve: Javed and Claesson 2011
	# used for vertical boreholes
	Dt = lm/Cm             	 # thermal diffusivity [m2/s]
	r = np.sqrt(x**2+y**2)   # radial distance [m]	
	g = (1.0/4.0/np.pi/lm)*(integrate.quad(lambda s,r,H,Dt,t: np.exp(-r**2 * s**2)* Ils(H*s,1*s)/(H*s**2),1/np.sqrt(4*Dt*t),np.inf,args = (r,H,Dt,t))[0])
	return g

def g_FLSjc_h(zi,zj,yi,yj,ro,H1,H2,dx,lm,Cm,t):
	# horizontal FLS Lamarche 2019
	# used for horizontal pipes
	'''
	r = radius pipe/borehole
	ri = imagenary radius
	H1 = length of pipe segment active
	H2 = length of pipe segment of interest
	dx = distance between active segment and segment of interest
	
	if only one segment:
	H1 = H2
	dx = 0
	
	'''
	
	if (zi-zj == 0) and (yi - yj == 0):
		zj = zj+ro
	
	r = np.sqrt((yi-yj)**2 + (zi-zj)**2)
	ri = np.sqrt((yi-yj)**2 + (zi+zj)**2)

	'''
	above pipe:
	zj = zi-r	
	r = zi-(zi-r) = r
	ri = zi+(zi-r) = 2zi-r
	
	below pipe:
	zj = zi+r
	r = zi-(zi+r) = -r
	ri = zi+(zi+r) = 2zi + r
	
	'''
	
	Dt = lm/Cm             	 # thermal diffusivity [m2/s]
	g = (1.0/4.0/np.pi/lm/H1)*(integrate.quad(lambda s,r,ri,H1,H2,dx,Dt,t:(np.exp(-r**2 * s**2) - np.exp(-ri**2 * s**2))/s**2 * (ierf(dx*s + H2*s) - ierf(dx*s) + ierf(dx*s-H1*s) - ierf(dx*s + H2*s - H1*s)),1/np.sqrt(4*Dt*t),np.inf,args = (r,ri,H1,H2,dx,Dt,t))[0])	
	return g
	
def FourierSci(a):
	# FFT transform
	return fft(np.concatenate((a,np.zeros(a.size-1))))
	
def invFourierSci(a):
	# inverse FFT transform
	return np.real(ifft(a))[0:int((a.size+1)/2)]	

def forward(sys_load,T01,T02,T0_BHE,gfuncs,coeffs,old):
	# model for BHE and connection pipes, see https://doi.org/10.1016/j.geothermics.2023.102679
	
	nSteps = sys_load.size
	g11 = gfuncs['gfunc_supply_pipe']
	g12 = gfuncs['gfunc_supply_to_return_pipe']
	g22 = gfuncs['gfunc_return_pipe']
	g21 = gfuncs['gfunc_return_to_supply_pipe']
	gBHE = gfuncs['gfunc_BHE']
	
	g11_0 = g11[0]
	g12_0 = g12[0]
	g22_0 = g22[0]
	g21_0 = g21[0]
	gBHE_0 = gBHE[0] 
	
	A = coeffs['supply']
	B = coeffs['return']
	C = coeffs['BHE']
	Rb = coeffs['Rb']
	
	l_BHE = coeffs['length_BHE']
	l_pipe = coeffs['length_pipe']
	
	q1_old = old['q1_old']
	q2_old = old['q2_old']
	q_BHE_old = old['q_BHE_old']
	
	Ts1 		= np.zeros(nSteps)
	Ts2 		= np.zeros(nSteps)	
	q_BHE 		= np.zeros(nSteps)			
	q1	 		= np.zeros(nSteps)
	q2	 		= np.zeros(nSteps)
	Tin_BHE 	= np.zeros(nSteps)	
	Tout_BHE	= np.zeros(nSteps)
	Tf	 		= np.zeros(nSteps)	
	Tb	 		= np.zeros(nSteps)
	
	a = np.array([	[-A,	0,		0,			-1,			0,			A,    0,    0,    0],
					[0,		-B,		0,			0,			-1,			0,    B,    0,    0],
					[1,		0,		0,			-g11_0,		-g21_0,		0,    0,    0,    0],
					[0,		1,		0,			-g21_0,		-g22_0,		0,    0,    0,    0],
					[0,		0,		+C,			0,			0,			-1,   0,    1,    0],
					[0,		0,		-C,			0,			0,			0,   -1,    1,    0],
					[0,		0,		Rb,			0,			0,			0,    0,    -1,   1],
					[0,		0,		l_BHE,		l_pipe,		l_pipe,		0,    0,    0,    0],
					[0,		0,		-gBHE_0,	0,			0,			0,    0,    0,    1]])
	
	for i in range(0,nSteps):	
		
		q_sys = sys_load[i]		
		if q_sys != 0:
			# setup and solve system of equations
			b = np.array([0,
						  0,
						  T01[i] -q1_old*g11_0 -q2_old*g21_0,
						  T02[i] -q2_old*g22_0 -q1_old*g12_0,
						  0,
						  0,
						  0,
						  q_sys,T0_BHE[i] + -q_BHE_old*gBHE_0])
			
			results = np.linalg.solve(a,b)
			
			# save results
			Ts1[i] 		= results[0]
			Ts2[i] 		= results[1]	
			q_BHE[i] 	= results[2]			
			q1[i] 		= results[3]
			q2[i] 		= results[4]
			Tin_BHE[i] 	= results[5]	
			Tout_BHE[i] = results[6]
			Tf[i] 		= results[7]	
			Tb[i] 		= results[8]
		
		else:
			q_BHE[i]  = 0
			q1[i]  = 0
			q2[i] =  0
		
		
		# variables for next time step
		q1_old = q1[i] 
		q2_old = q2[i] 
		q_BHE_old = q_BHE[i]
		
		# Temperatures for all following steps
		T01[i:nSteps] += (q1[i]-q1[i-1]) * g11[0:nSteps-i]
		T01[i:nSteps] += (q2[i]-q2[i-1]) * g12[0:nSteps-i]
		
		T02[i:nSteps] += (q2[i]-q2[i-1]) * g22[0:nSteps-i]
		T02[i:nSteps] += (q1[i]-q1[i-1]) * g21[0:nSteps-i]
		
		T0_BHE[i:nSteps] += (q_BHE[i]-q_BHE[i-1]) * gBHE[0:nSteps-i]

	Tout_CP = Tout_BHE - q2*l_pipe/(l_BHE/(2*C))
	Tin_CP = Tin_BHE + q1*l_pipe/(l_BHE/(2*C))
	
	Tout_CP[sys_load==0] = float('nan')
	Tin_CP[sys_load==0] = float('nan')
	Tout_BHE[sys_load==0] = float('nan')
	Tin_BHE[sys_load==0] = float('nan')
	
	return q_BHE,q1,q2,Ts1,Ts2,Tin_BHE,Tout_BHE,Tin_CP,Tout_CP 

def calc_FFT_sec(gfuncs,tlog,q_BHE,q1,q2,nt_future,dt,T0_p1,T0_p2,T0_BHE):
	# FFT model for hybrid approach, see https://doi.org/10.1002/nag.3427
	
	nsteps_total = q_BHE.size + nt_future
	Time = np.linspace(dt,nsteps_total*dt,nsteps_total)

	# convert loads
	q_BHE_gload = np.concatenate([q_BHE,np.zeros(nt_future)])		
	q_BHE_gload[1:] -= np.roll(q_BHE_gload,1)[1:]
	q_BHE_gload = FourierSci(q_BHE_gload)
	
	q1_gload = np.concatenate([q1,np.zeros(nt_future)])		
	q1_gload[1:] -= np.roll(q1_gload,1)[1:]
	q1_gload = FourierSci(q1_gload)
	
	q2_gload = np.concatenate([q2,np.zeros(nt_future)])		
	q2_gload[1:] -= np.roll(q2_gload,1)[1:]
	q2_gload = FourierSci(q2_gload)
	
	# Temperatures 
	fG = interpolate.interp1d(tlog,gfuncs['gfunc_BHE'])
	FFT_Gfunc = FourierSci(fG(Time))				
	T0_BHE += np.real(invFourierSci(q_BHE_gload*FFT_Gfunc)) 
	
	fG = interpolate.interp1d(tlog,gfuncs['gfunc_supply_to_return_pipe'])
	FFT_Gfunc_g12 = FourierSci(fG(Time))				
	fG = interpolate.interp1d(tlog,gfuncs['gfunc_supply_pipe'])
	FFT_Gfunc_g11 = FourierSci(fG(Time))
	
	T0_p1 += np.real(invFourierSci(q1_gload*FFT_Gfunc_g11)) 
	T0_p1 += np.real(invFourierSci(q2_gload*FFT_Gfunc_g12)) 
	
	T0_p2 += np.real(invFourierSci(q2_gload*FFT_Gfunc_g11)) 
	T0_p2 += np.real(invFourierSci(q1_gload*FFT_Gfunc_g12)) 
	
	return T0_BHE,T0_p1,T0_p2


